Futurama: Into the Wild Green Yonder (2009)  

Verenigde Staten
Animatie / Komedie
88 minuten

geregisseerd door Peter Avanzino
met de stemmen van Billy West, Katey Sagal en John Di Maggio

Er staat weer werk te wachten op de bemanning van Planet Express; Leela is op de vlucht, Bender is verliefd, en Fry moet het universum redden van donkere wezens die het aankomende groene tijdperk proberen te verhinderen.


